import React from "react"; 
import { Link } from "react-router-dom";
import landingPa from "./langinPa.module.css";


function landingPage() {
    return <div>
    
    <header>
        <nav>
            <div className={landingPa.logo}>
                <img src="./images/check-p.png" alt="" />
            </div>
            <div className={landingPa.links}>
                <a href="/" classNmae={landingPa.btnlogin}>Log In</a>
                <a href="/" className={landingPa.btnregister} >Get started</a>
            </div>
        </nav>
    </header>

    </div>
}
export default landingPage;
